import React from 'react'

const Cart = () => {
  return (
    <section className="cart-section">
        <div className="wrap cart-wrap">
            <div className="cartDetail-sec"></div>
            <div className="placeOrder-sec"></div>
        </div>
    </section>
  )
}

export default Cart
